<script>
import { queryStudents, addStudent, deleteStudent } from '@/api/students'

export default {
  name: 'About',
  components: {},
  data() {
    return {
      content: '',
    }
  },
  methods: {
    handleQueryClick() {
      const params = {
        class: 'senior',
      }
      queryStudents(params).then((rsp) => {
        this.content = JSON.stringify(rsp)
      })
    },
    handleAddClick() {
      const params = {
        name: 'sheldon',
      }
      addStudent(params).then((rsp) => {
        this.content = JSON.stringify(rsp)
      })
    },
    handleDeleteClick() {
      deleteStudent().then((rsp) => {
        this.content = JSON.stringify(rsp)
      })
    },
  },
}
